//index.js
import React from "react";
import { BrowserRouter as Router, Switch } from "react-router-dom";
import { Breadcrumb } from "solidoc-ase-component-lib"; //引用Breadcrumb
import List from "./list"; //更改为自己的List路径

function Demo() {
  const upDateList = type => {
    switch (type) {
      case "/it":
        return [
          {
            icon: "🍉",
            title: "IT技术",
            url: "./it",
            component: "ITPage"
          }
        ];
      case "/react":
        return [
          {
            icon: "🍉",
            title: "IT技术",
            url: "./it",
            component: "ITPage"
          },
          {
            icon: "🍔",
            title: "React",
            url: "./react",
            component: "ReactPage"
          }
        ];
      case "/router":
        return [
          {
            icon: "🥭",
            title: " React-hook",
            url: "./router",
            component: "RouterPage"
          }
        ];
      case "/":
        return [
          {
            icon: "🍉",
            title: "IT技术",
            url: "./it",
            component: "ITPage"
          },
          {
            icon: "🍔",
            title: "React",
            url: "./react",
            component: "ReactPage"
          },

          {
            icon: "🥭",
            title: " React-hook",
            url: "./router",
            component: "RouterPage"
          }
        ];
    }
  };
  return (
    <div>
      <Router>
        <Breadcrumb upDateList={upDateList} />
        <Switch>
          <List />
        </Switch>
      </Router>
    </div>
  );
}
export default Demo;
